import React from 'react';
import { Link } from 'react-router-dom';

function Menu() {
  return (
    <>
      <nav className="navbar navbar-expand-lg bg-dark p-20px">
        <div className="container-fluid">
          <Link className="navbar-brand text-white" to="/">Menu</Link> {/* Added text-white class */}
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav">
              <li className="nav-item">
                <Link className="nav-link active text-white" aria-current="page" to="/">Home</Link> {/* Added text-white class */}
              </li>
              <li className="nav-item">
                <Link className="nav-link text-white" to="/create">UserCreate</Link> {/* Added text-white class */}
              </li>
              <li className="nav-item">
                <Link className="nav-link text-white" to="/read">UserRead</Link> {/* Added text-white class */}
              </li>
              <li className="nav-item">
                <Link className="nav-link text-white" to="/search">UserSearch</Link> {/* Added text-white class */}
              </li>
              <li className="nav-item">
                <Link className="nav-link text-white" to="/update">Userupdate</Link> {/* Added text-white class */}
              </li>
            </ul>
          </div>
        </div>
      </nav>
    </>
  );
}

export default Menu;
